import axios from "axios";

axios.defaults.headers.common["Content-Type"] = "application/json";
axios.defaults.headers.common["scd"] = "CARMASTERSCD";

axios.interceptors.response.use(
    (response) => {
        return response;
    },
    (error) => {
        let conifg = error.config
        let data = error.response?.data
        if (data) {
            if (data.code === 1000) {
                // Ïù¥Ïö©Ï†úÌïú Í≥ÑÏ†ï
                console.log("üöÄ ~ error:", error)
                localStorage.setItem("token", "")
                if (conifg.url.indexOf("/login/login") < 0) {
                    window.location.href = "/login"
                    return;
                }
            } else if (data.code === 1100) {
                // Î°úÍ∑∏Ïù∏ ÌïÑÏöî
                localStorage.setItem("token", "")
                window.location.href = "/login"
            }
        }
        return Promise.reject(error);
    }
)

export const postData = (url, sender = {}) => {
    axios.defaults.headers.common["authorization"] = localStorage.getItem('token');

    let dm = "http://127.0.0.1:4000";


    return axios.post(dm + `${url}`, sender);
};
